import React from 'react'
import './Footer.css'


export default function Footer() {
  const backgroundImage = './../../Imagess/shape-bg.png';
  return (
    <div className='footer-container'>
        <div className='footer-parent'>
            <img alt='No internet connection' />
        </div>
    </div>
  )
}
